import React from "react";
import "../Components/Navbar.css";
import Logo from "../Images/Logo.svg";
import {Links} from "../data";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Col from "react-bootstrap/Col";
import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";

const NavigationBar = () => {
  return (
    <Container fluid className='sticky-nav p-0'>
      <Navbar className='py-4 px-5' bg='light' variant='light'>
        <Col md={3}>
          <Navbar.Brand href='/'>
            <img src={Logo} alt='Meeco' width={200} />
          </Navbar.Brand>
        </Col>

        <Navbar.Toggle aria-controls='navbarScroll' />
        <Navbar.Collapse id='navbarScroll'>
          <Nav
            className='me-auto my-2 my-lg-0'
            style={{maxHeight: "100px"}}
            navbarScroll
          >
            <Nav.Link href='#action1'>Home</Nav.Link>
            <Nav.Link href='#action2'>Link</Nav.Link>
            <NavDropdown title='Link' id='navbarScrollingDropdown'>
              <NavDropdown.Item href='#action3'>Action</NavDropdown.Item>
              <NavDropdown.Item href='#action4'>
                Another action
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href='#action5'>
                Something else here
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href='#' disabled>
              Link
            </Nav.Link>
          </Nav>
          <Form className='d-flex'>
            <Form.Control
              type='search'
              placeholder='Search'
              className='me-2'
              aria-label='Search'
            />
            <Button variant='outline-success'>Search</Button>
          </Form>
        </Navbar.Collapse>

        <Col md={6}>
          <Nav className='justify-content-center'>
            {Links.map(({name, path}, index) => {
              return (
                <li key={index}>
                  <Nav.Link
                    style={{fontWeight: 500, fontSize: 18}}
                    className='justify-content-center px-3'
                    href={path}
                  >
                    {name}
                  </Nav.Link>
                </li>
              );
            })}
          </Nav>
        </Col>

        <Col md={3}>
          <Nav className='justify-content-end'>
            <Button
              variant='outiline-color-light'
              className='second-button mr-4'
              type='search'
              onClick={"search"}
            >
              <i class='fa-sharp fa-solid fa-magnifying-glass'></i>
            </Button>

            <Button className='button' type='submit' onClick={"submit"}>
              Get in Touch
            </Button>
          </Nav>
        </Col>
      </Navbar>
    </Container>
  );
};
export default NavigationBar;
